Monterey Motel — Home for the next few days.

This place was my favorite go to motel every time I needed an overnight in Albuquerque. When Henry and Bo told me they were placing the motel up for sale I was gravely concerned about the future of the place. I have stayed here six times now since the renovations, and every visit has done nothing but reinforce my original impression that the developers have done a heroic job transforming this historic property and making it viable for future generations of Route 66 travelers to enjoy. Some of them may not even be aware they’re on the fabled 66 but a quick look around in the lounge and at the artwork on the walls might just open up a whole new world for those people, and I’ll say to them what was said to me when I discovered this legendary highway: Welcome Route 66 Travelers😎

